 // @dev Sanity check that allows us to ensure that we are pointing to the\n    //  right auction in our setSaleAuctionAddress() call.\n    bool public isSaleClockAuction = true;\n\n    // Tracks last 5 sale price of gen0 kitty sales\n    uint256 public gen0SaleCount;\n    uint256[5] public lastGen0SalePrices;\n\n    // Delegate constructor\n    function SaleClockAuction(address _nftAddr, uint256 _cut) public\n        ClockAuction(_nftAddr, _cut) {}\n\n    /// @dev Creates and begins a new auction.\n    /// @param _tokenId - ID of token to auction, sender must be owner.\n    /// @param _startingPrice - Price of item (in wei) at beginning of auction.\n    /// @param _endingPrice - Price of item (in wei) at end of auction.\n    /// @param _duration - Length of auction (in seconds).\n    /// @param _seller - Seller, if not the message sender\n    function createAuction(\n        uint256 _tokenId,\n        uint256 _startingPrice,\n        uint256 _endingPrice,\n        uint256 _duration,\n        address _seller\n    )\n        public\n        canBeStoredWith128Bits(_startingPrice)\n        canBeStoredWith128Bits(_endingPrice)\n        canBeStoredWith64Bits(_duration)\n    {\n        require(msg.sender == address(nonFungibleContract));\n        _escrow(_seller, _tokenId);\n        Auction memory auction = Auction(\n            _seller,\n            uint128(_startingPrice),\n            uint128(_endingPrice),\n            uint64(_duration),\n            uint64(now)\n        );\n        _addAuction(_tokenId, auction);\n    }\n\n    /// @dev Updates lastSalePrice if seller is the nft contract\n    /// Otherwise, works the same as default bid method.\n    function bid(uint256 _tokenId)\n        public\n        payable\n    {\n        // _bid verifies token ID size\n        address seller = tokenIdToAuction[_tokenId].seller;\n        uint256 price = _bid(_tokenId, msg.value);\n        _transfer(msg.sender, _tokenId);\n\n        // If not a gen0 auction, exit\n        if (seller == address(nonFungibleContract)) {\n            // Track gen0 sale prices\n            lastGen0SalePrices[gen0SaleCount % 5] = price;\n            gen0SaleCount++;\n        }\n    }\n\n    function averageGen0SalePrice() external view returns (uint256) {\n        uint256 sum = 0;\n        for (uint256 i = 0; i < 5; i++) {\n            sum += lastGen0SalePrices[i];\n        }\n        return sum / 5;\n    }\n\n}',sourcePath:"/Users/holly/CS359B/cs359b-cryptochans/contracts/Auction/SaleClockAuction.sol",ast:{absolutePath:"/Users/holly/CS359B/cs359b-cryptochans/contracts/Auction/SaleClockAuction.sol",exportedSymbols:{SaleClockAuction:[840]},id:841,nodeType:"SourceUnit",nodes:[{id:678,literals:["solidity","^","0.4",".21"],nodeType:"PragmaDirective",src:"0:24:2"},{absolutePath:"/Users/holly/CS359B/cs359b-cryptochans/contracts/Auction/ClockAuction.sol",file:"./ClockAuction.sol",id:679,nodeType:"ImportDirective",scope:841,sourceUnit:295,src:"26:28:2",symbolAliases:[],unitAlias:""},{baseContracts:[{arguments:null,baseName:{contractScope:null,id:680,name:"ClockAuction",nodeType:"UserDefinedTypeName",referencedDeclaration:294,src:"225:12:2",typeDescriptions:{typeIdentifier:"t_contract$_ClockAuction_$294",typeString:"contract ClockAuction"}},id:681,nodeType:"InheritanceSpecifier",src:"225:12:2"}],contractDependencies:[294,676,1569,1719],contractKind:"contract",documentation:"@title Clock auction modified for sale of kitties\n @notice We omit a fallback function to prevent accidental sends to this contract.",fullyImplemented:!0,id:840,linearizedBaseContracts:[840,294,676,1569,1719],name:"SaleClockAuction",nodeType:"ContractDefinition",nodes:[{constant:!1,id:684,name:"isSaleClockAuction",nodeType:"VariableDeclaration",scope:840,src:"382:37:2",stateVariable:!0,storageLocation:"default",typeDescriptions:{typeIdentifier:"t_bool",typeString:"bool"},typeName:{id:682,name:"bool",nodeType:"ElementaryTypeName",src:"382:4:2",typeDescriptions:{typeIdentifier:"t_bool",typeString:"bool"